import React from 'react';
import { Navbar } from 'react-bootstrap';
const navbarStyle = {
  backgroundColor:'lightblue'
}
const Header = (props) => {
  return (
    <Navbar style={navbarStyle} bg="light" variant="light">
      <Navbar.Brand href="/">{props.title}</Navbar.Brand>
    </Navbar>
  )
}

export default Header;
